  <body>
    <div id="root"></div>
    <script>
      document.documentElement.addEventListener(
        'touchstart',
        function (event) {
          if (event.touches.length > 1) {
            event.preventDefault();
          }
        },
        false,
      );
      let lastTouchEnd = 0;
      document.documentElement.addEventListener(
        'touchend',
        function (event) {
          const now = Date.now();
          if (now - lastTouchEnd <= 300) {
            event.preventDefault();
          }
          lastTouchEnd = now;
        },
        false,
      );
    </script>
